import { Greeting } from "./components/greeting/Greeting";
import { Routes } from "./routes/Routes";

function App() {
  return (
    <Routes>
      <Greeting name="Jane"/>    
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
    </Routes>
  );
}

export default App;
